import subprocess
import importlib.util
import sys
import platform
import os

required_modules = [
    "pyfiglet",
    "telebot",
    "requests",
]
def install_module(module_name):
    subprocess.check_call([sys.executable, "-m", "pip", "install", module_name])
for module in required_modules:
    try:
        importlib.import_module(module)
        print(f"{module} modülü zaten yüklü.")
    except ImportError:
        print(f"{module} modülü bulunamadı. Otomatik olarak kuruluyor...")
        install_module(module)
if platform.system() == 'Windows':
    print("Program Bilgisayar Sürümü Uyumlu Değildir, Exe Formatında Kullanabilirsiniz..")
    os.system("start https://github.com/marselius1/TR-Fake-Number-")
